import React from 'react';

class Pokemon extends React.Component {

  render() {
    const { pokedata } = this.props;

    return (
      <div>
        {pokedata.map((element) => (
          `Nome: ${element.name},
           Tipo: ${element.type},
           Peso: ${element.averageWeight},
           Foto: ${element.image},`
        ))}
      </div>
    )
  }
}

export default Pokemon;
